func testCompetitionToManyAddOpRelatedCompetitionCompetitionConfigs(t *testing.T) {
	var err error

	tx := MustTx(boil.Begin())
	defer func() { _ = tx.Rollback() }()

	var a Competition
	var b, c, d, e CompetitionConfig

	seed := randomize.NewSeed()
	if err = randomize.Struct(seed, &a, competitionDBTypes, false, strmangle.SetComplement(competitionPrimaryKeyColumns, competitionColumnsWithoutDefault)...); err != nil {
		t.Fatal(err)
	}
	foreigners := []*CompetitionConfig{&b, &c, &d, &e}
	for _, x := range foreigners {
		if err = randomize.Struct(seed, x, competitionConfigDBTypes, false, strmangle.SetComplement(competitionConfigPrimaryKeyColumns, competitionConfigColumnsWithoutDefault)...); err != nil {
			t.Fatal(err)
		}
	}

	if err := a.Insert(tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}
	if err = b.Insert(tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}
	if err = c.Insert(tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}

	foreignersSplitByInsertion := [][]*CompetitionConfig{
		{&b, &c},
		{&d, &e},
	}

	for i, x := range foreignersSplitByInsertion {
		err = a.AddRelatedCompetitionCompetitionConfigs(tx, i != 0, x...)
		if err != nil {
			t.Fatal(err)
		}

		first := x[0]
		second := x[1]

		if !queries.Equal(a.ID, first.RelatedCompetitionID) {
			t.Error("foreign key was wrong value", a.ID, first.RelatedCompetitionID)
		}
		if !queries.Equal(a.ID, second.RelatedCompetitionID) {
			t.Error("foreign key was wrong value", a.ID, second.RelatedCompetitionID)
		}

		if first.R.RelatedCompetition != &a {
			t.Error("relationship was not added properly to the foreign slice")
		}
		if second.R.RelatedCompetition != &a {
			t.Error("relationship was not added properly to the foreign slice")
		}

		if a.R.RelatedCompetitionCompetitionConfigs[i*2] != first {
			t.Error("relationship struct slice not set to correct value")
		}
		if a.R.RelatedCompetitionCompetitionConfigs[i*2+1] != second {
			t.Error("relationship struct slice not set to correct value")
		}

		count, err := a.RelatedCompetitionCompetitionConfigs().Count(tx)
		if err != nil {
			t.Fatal(err)
		}
		if want := int64((i + 1) * 2); count != want {
			t.Error("want", want, "got", count)
		}
	}
}

